pragma solidity ^0.4.4;

import "./bancor/BancorConverter.sol";

/*
    Override bancor converter to replace references to the virtual balance
    This allows a buffer for dividends so the virtual balance slowly approaches the actual balance
*/
contract LiquidConverter is BancorConverter {

    // to do variables for buffer start, end

    // just pass everything through to bancor converter constructor
    function LiquidConverter(ISmartToken _token, IBancorConverterExtensions _extensions, uint32 _maxConversionFee, IERC20Token _connectorToken, uint32 _connectorWeight)
        BancorConverter(_token, _extensions, _maxConversionFee, _connectorToken, _connectorWeight)
        public
    {
    }

    // update the connectors virtual balance so the bancor converter has it up to date
    function bufferVirtualBalance(IERC20Token _connectorToken)
        private
    {
        Connector storage connector = connectors[_connectorToken];
        // connector.virtualBalance += 1;
        // to do
    }

    // allows trustee to send dividends (as connector tokens) that add to the connector balance without minting and update the virtual balance buffer
    function depositDividends()
        public
    {
        // to do
    }

    /* function getConnectorBalance(IERC20Token _connectorToken)
        public
        returns (uint256)
    {
        bufferVirtualBalance(_connectorToken);
        return super.getConnectorBalance(_connectorToken);
    } */

    function buy(IERC20Token _connectorToken, uint256 _depositAmount, uint256 _minReturn)
        public
        returns (uint256)
    {
        bufferVirtualBalance(_connectorToken);
        return super.buy(_connectorToken, _depositAmount, _minReturn);
    }

    function sell(IERC20Token _connectorToken, uint256 _sellAmount, uint256 _minReturn)
        public
        returns (uint256)
    {
        bufferVirtualBalance(_connectorToken);
        return super.sell(_connectorToken, _sellAmount, _minReturn);
    }
}
